INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3770000670080', 'Nutreov Triolinum Jour / Nuit Menopause 120 Gelules (menopause)', 'CONSEILS D\'UTILISATION : Prendre 1 gélule Jour te matin, 1 gélule Nuit le soir au coucher, Possibilité de doubler la prise si nécessaire. INGRÉDIENTS (pour 2 gélules JOUR) : Carbonate de calcium (soit 198 mg / 25% VNR* de Calcium élément) - Extrait de houblon Humulus lupulus L. (300 mg) - Gélatine alimentaire - Extrait de lin Linum usitatissimum L. (80 mg soit 16 mg SDG**) - Anti-agglomérants : Silice colloïdale [nano], Stéarate de magnésium - Colorant alimentaire : El 71 - Vitamine D (cholécalciférol - 2,5 Hg / 50% VNR*). INGRÉDIENTS (pour 2 gélules NUIT) : Extrait sec de mélisse Melissa officinalis L. (400 mg) Phosphate de calcium (soit 66 mg / 8% VNR* de Calcium élément) - Gélatine alimentaire - Extrait de houblon Humulus lupulus L. (100 mg) - Extrait de lin Linum usitatissimum L. (20 mg soit 4 mg SDG**) - Antiagglomérants : Silice colloïdale [nano], Stéarate de magnésium - Super Oxyde Dismutase (SOD) de melon (10mg) - Vitamine D (cholécalciférol - 2,5 pg / 50% VNR*) - Colorants alimentaires E171, E132. *', '', '0', '0', '0', '0', '', '0', '0', '0', '', '1');

