VALUES ('3770000676006', 'Miel Peyi a', 'Le miel aliment PUR ET NATUREL connu début de l\'humanité, est élaboré par les abeilles avec le nectar de fleurs. Il ne contient ni colorant, ni conservateur. Très riche glucose et fructose, il est directemert assimilable. Tonifiant et énergétique, sa composition fait de lui un aliment recommandé aux sportifs et aux enfants. Lors de la cristallisation du miel, phénomène naturel, des marbrures peuvent apparaître. Elles ne sont pas le signe d\'une quelconque altération. Le miel reste parfaitement consommable. Le miel cristallisé peut être rendu pâteux ou liquide par un simple bain-marie de quelques minutes.', 'https://static.openfoodfacts.org/images/products/377/000/067/6006/front_fr.4.400.jpg', '0', '0', '76.4', '0', '', '0.4', '0', '0', '', '1');

