VALUES ('3770001361147', 'Psyllium Blond Bio - 150 G - Nature & Partage', 'Le tégument de psyllium blond, l\'ami du coion 11 aide à maintenir une bonne santé intestinale en facilitant le transit et la digestion. 11 régule la teneur en eau des selles. Cest un laxatif de lest dont l\'effet est purement mécanique. Il est aussi un coupe-faim naturel. Conseils d\'utilisation: Commencer avec une cuillerée à café par jour. Bien mélanger dans un verre d\'eau et boire immédiatement, puis boire à nouveau un verre dieau. Si nécessaire, augmenter graduellement la dose par paliers de plusieurs jours. Il appartient à chacun de trouver sa dose optimale, pouvant aller jusqu\'à 3 ou 4 cuillerées à soupe par jour (30 g).', 'https://static.openfoodfacts.org/images/products/377/000/136/1147/front_fr.4.400.jpg', '0.2', '0.01', '0.1', '0.1', '85.5', '3', '0', '0', '', '1');

